    <div className='posts'>
        <h4>Front-End Developer-Amazon</h4>
        <p>Temporary</p>
        <div className='skillist'>
           {skills.map((skill)=>(
            <p>{skill}</p>
            ))}
        </div>
    </div>
  )
}
